import React, { Component } from "react";

export default class Userinfo extends Component {
  render() {
    const { imgUrl: avatar, first_name, last_name } = this.props;

    return (
      <aside>
        <img src={avatar} alt="" />
        <h1>user comp</h1>
        <h2>{`${first_name} ${last_name ? last_name : ""}`}</h2>
      </aside>
    );
  }
}
